import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import './App.css';
import HomePage from './pages/HomePage/HomePage';

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route index element={<HomePage />}></Route>
            </Routes>
        </BrowserRouter>
    );
}

export default App;
